import React from 'react';

export default class Hed extends React.Component {
  render() {
    return (
      <div className='hed'>
        <div className='hedp'>
          <p>
            <i class='fas fa-phone'></i> +00 (123) 456 7890
          </p>
          <p>
            <i class='far fa-envelope'></i> INFO@DOMAIN.COM
          </p>
        </div>
      </div>
    );
  }
}
